svg.script:
	document.getElementById("svgroot").addEventListener("mouseover", sendClickToParentDocument, false);        
        function sendClickToParentDocument(evt)  {
            // SVGElementInstance objects aren't normal DOM nodes, so fetch the corresponding 'use' element instead
            var target = evt.target;
            if(target.correspondingUseElement)
                target = target.correspondingUseElement;
      
      // call a method in the parent document if it exists
      if (window.parent.svgElementClicked)
                window.parent.svgElementClicked(target, "tax");
            else
                return; //alert("You clicked '" + target.id + "' which is a " + target.nodeName + " element");
        }
